The proposal comprises:
•	The establishment of a 10.0m x 10.0m site compound;
•	The construction of 1.15m stock fencing around the compound; 
•	The installation of an equipment shelter (3.0m x 2.3m):  
•	The installation of a new 35m concrete monopole; 
•	The installation of a triangular headframe mounted to the top of the monopole;
•	The installation of nine (9) panel antennas on mounting poles attached to the headframe;
•	The installation of ancillary equipment such as radio remote units, transceivers, amplifiers, antenna mounts, feeders, cabling, combiners, signage, and other associated equipment.

The following permit triggers apply:  
	Subdivision of land in the applied General Residential Zone (Clause 32.08-3);
	Subdivision of land in the Rural Conservation Zone (Clause 35.06-3); 
	Earthworks which change the rate of flow or the discharge point of water across a property boundary in the Rural Conservation Zone (Clause 35.06-5); 
	Subdivision of land in the Urban Growth Zone (Clause 37.07-10); 
	Subdivision of land in the Environmental Significance Overlay (Clause 42.01-2);
	Buildings and works (bicycle pathway) within an Environmental Significance Overlay (Clause 42.01-2);
	Subdivision, demolition and building and works within a Heritage Overlay (Clause 43.01-1);
	Remove, destroy or lop a tree if the schedule to this overlay specifies the heritage place as one where tree controls apply (Clause 43.01-1) (this only applies to River Red Gums within HO204); 
	Buildings and works (bicycle pathway) within the Floodway Overlay (Clause 44.03-1);
	Subdivision of land in the Floodway Overlay (Clause 44.03-2);
	Subdivision of land affected by the Public Acquisition Overlay (Clause 45.01-1);
	Damage, remove, destroy or lop any vegetation within the Public Acquisition Overlay (Clause 45.01-1);
	Buildings and works in a Public Acquisition Overlay (Clause 45.01-1);
	Creation of Restrictions (Clause 52.02); 
	Remove, destroy or lop native vegetation, including dead native vegetation (Clause 52.17); 
	Create or alter access and subdivide land adjacent to land in a Public Acquisition Overlay if the purpose of acquisition is for a Category 1 road (Clause 52.29-2);
	Removal of Dry-Stone Walls (Clause 52.33); and 
	Subdivision of land in more than one zone (Clause 64.03).
